(with-primitive-procedures [b2i levenshtein-abc-dist randomwhitespacedist]
  (defquery dateparser [obsdatestr]
    (let [locale (sample (categorical [[:europe 5] [:usa 5]]))
          year (sample (uniform-discrete -500 2100))
          month (sample (uniform-discrete 1 13))

          leap-year (sample (flip 0.5))
          separator-char (sample (categorical [["/" 4] ["-" 3] [" " 3]]))
          month-text (cond (= month 1) (sample (categorical [["1" 5] ["Jan" 5] ["Jan." 5] ["JAN" 5] ["JANUARY" 5] ["January" 5]]))
                           (= month 2) (sample (categorical [["2" 5] ["Feb" 5] ["Feb." 5] ["FEB" 5] ["FEBRUARY" 5] ["February" 5]]))
                           (= month 3) (sample (categorical [["3" 5] ["Mar" 5] ["Mar." 5] ["MAR" 5] ["MARCH" 5] ["March" 5]]))
                           (= month 4) (sample (categorical [["4" 5] ["April" 5] ["Apr." 5] ["APR" 5] ["APRIL" 5] ["April" 5]]))
                           (= month 5) (sample (categorical [["5" 5] ["May" 5] ["May." 5] ["MAY" 5]]))
                           (= month 6) (sample (categorical [["6" 5] ["June" 5] ["Jun." 5] ["JUN" 5] ["JUNE" 5] ["June" 5]]))
                           (= month 7) (sample (categorical [["7" 5] ["July" 5] ["Jul." 5] ["JUL" 5] ["JULY" 5] ["July" 5]]))
                           (= month 8) (sample (categorical [["8" 5] ["August" 5] ["Aug." 5] ["AUG" 5] ["AUGUST" 5] ["August" 5]]))
                           (= month 9) (sample (categorical [["9" 5] ["September" 5] ["Sept." 5] ["Sep." 5] ["SEPT" 5] ["SEP" 5] ["SEPTEMBER" 5] ["September" 5]]))
                           (= month 10) (sample (categorical [["10" 5] ["October" 5] ["Oct." 5] ["OCT" 5] ["OCTOBER" 5] ["October" 5]]))
                           (= month 11) (sample (categorical [["11" 5] ["November" 5] ["Nov." 5] ["NOV" 5] ["NOVEMBER" 5] ["November" 5]]))
                           (= month 12) (sample (categorical [["12" 5] ["December" 5] ["Dec." 5] ["DEC" 5] ["DECEMBER" 5] ["December" 5]])))
          day (cond
                (contains? [9 4 6 11] month) (sample (uniform-discrete 1 31)) 
                (contains? [2] month) (sample (uniform-discrete 1 (- 30 (b2i leap-year))))
                :else (sample (uniform-discrete 1 32)))
          
          year-text (if (< year 0) (str (- 0 year) (sample (categorical [["BC" 5] ["bc" 5] ["B.C." 5] ["b.c." 5]]))) (str year))
          gendatestr (cond (= locale :europe) (str day separator-char month-text separator-char year-text)
                             :else (str month-text separator-char day separator-char year-text))
          ]

          ;(str obsdatestr " : " gendatestr)
          (observe (levenshtein-abc-dist gendatestr 0.1) obsdatestr)
          {:year year :month month :day day :locale locale})))
