;; **
;;; ### Infcomp
;;; 
;;; First, run the inference server from torch-infcomp:
;;; 
;;; `python -m infcomp.infer`
;;; 
;;; Then run the query, specifying number of particles:
;; **

;; @@
(def num-particles 100)
(def csis-states (take num-particles (infer :csis dateparser [test-observation] :observe-embedder-input test-observation-onehot-representation)))
(take 5 (reverse (sort-by second 
         (vec (empirical-distribution (collect-results csis-states))))))
